 const[data, setData] = useState([])
 useEffect(() =>{
 fetch(url)
 .then(response =>
   response.json()
   )
   .then(json => 
    setData(json)
    )

 .catch(e =>{ 
   console.log('e', e)})
})
  return (

    <div>
       {data.map(user=>(
         <p>{user.name}</p>
       ))}

    </div>
  );
}

